import Home from './screens/Home';
import Profile from './screens/Profile';
import Search from './screens/Search';

//----------------------------------------------
//App Main

const App = () => {
	return (
	<SafeAreaView style={styles.root}>
			{/*<Login />	*/}
			<Home />
		</SafeAreaView>
	);
}

const styles = StyleSheet.create({
	root: {
		flex: 1,
		backgroundColor: '#ffcfe6',
	}

});

export default App;
